import React from "react";
import GoogleMap from "react-google-maps"

const Map = () => {
    return (
        <div className="map">
            <GoogleMap
                bootstrapURLKeys={{key: AIzaSyCj5PNydCUuDNVXqEiS5HEhH7WiS8i7Lks}}
                defaultZoom={15}
                defaultCenter={{lat: 37.5, lng: 127}}>
                </GoogleMap>
        </div>
    );
}

export default Map;
